import React from "react";
import logo from "./logo.svg";
import "./App.css";

let btnIdx = 0;

interface btnProps {
  idx: number;
  text: string;
}

function Btn(props: btnProps) {
  if (btnIdx === props.idx)
    return (
      <div>
        <p>hi</p>
        <p className="App-header-btn">{props.text}</p>
      </div>
    );
  else return <p className="App-header-btn">{props.text}</p>;
}

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <p className="App-title">Gym Battles</p>
        <p className="App-header-btn">Join Session</p>
      </header>
    </div>
  );
}

export default App;
